// Inside your Dashboard component

import React, { useEffect, useState } from "react";

const Dashboard = () => {
  const [fullStockLevel, setFullStockLevel] = useState(0);

  useEffect(() => {
    fetch("http://localhost:8000/all-accessories")
      .then((res) => res.json())
      .then((data) => (data))
      .catch((error) => console.error("Error fetching accessories:", error));
  }, []);

  const fetchFullStockLevel = async () => {
    try {
      const response = await fetch("/api/fullStockLevel");
      if (!response.ok) {
        throw new Error("Failed to fetch full stock level");
      }
      const data = await response.json();
      setFullStockLevel(data.fullStockLevel);
    } catch (error) {
      console.error("Error fetching full stock level:", error.message);
    }
  };

  return (
    <div>
      {/* Render other components */}
      <p>Full Stock Level: {fullStockLevel}</p>
    </div>
  );
};

export default Dashboard;
